import React from 'react';
 
const About = () => {
    return (
       <div className="about-page">
         <div className="container">
           <div className="row">
             <div className="col-12">
                <h1>About</h1>
                <p>We hebben als eindopdracht van React een Weather app gemaakt, met informatie die uit een API komt.</p>
             </div>
           </div>
         </div>
        </div>
    );
}
 
export default About;
